text:
 @fredthefish-  Copa do Brasil, Brasileirão, Sul-Americana, Libertadores e Mundial de Clubes são todos títulos importantes. Você só está sem argumentos porque o São Paulo ganhou esse ano. 😉 

Por que não pergunta para mim agora: "Cade sua Copa do Brasil?" 

Claro, Mundial e Libertadores são bem mais importantes. E São Paulo tem três de cada. 🇾🇪 😉

 @darkmadaras8697  Até parece que jogou 70 jogos.
Deve ter jogado uns 40-45 (ou seja, dá cerca de 1 assist./3 jogos - essa é aproximadamente as médias do Messi e do  Pelé).
Só na Copa do Brasil, foi o jogador com mais participações em gols na temporada: 2 gols e  3 assistências!

 @Ronaldostilo  ah Jesus amado

“Aí o são paulino” nitidamente e literalmente específica que o barulho e a feminização corporal é o são paulino que comete, é um cenário fictício indicando que o são paulino é viado.
Ta melhor pra você?

 @Leo_Cardosoo  Lógico que não. São Paulo tinha a obrigação de ter a mesma postura que teve quando enfrentou o Palmeiras na Copa do Brasil, quando venceu os dois jogos. No entanto, a partida mais importante do São Paulo no ano fora de casa foi essa:

MARACANÃ, 17 de setembro de 2023: Flamengo 0 X 1 São Paulo

Depois nem precisou vencer no Morumbi porque o resultado FORA DE CASA já foi suficiente.

 @imfnaf  o cara falou em um comentário ao público e eu respondi ele. 
Zé povinho é você de vir xeretar em algo que eu disse pra ele, não pra você. 
Então quem se doeu foi tu amigo, aprende a interpretar ai.
